import React from 'react';
import './index.css';

const AppointmentItem = ({ appointmentDetails, toggleIsStarred }) => {
  const {  title, email, gender, website, image, skills } = appointmentDetails;


  return (
    <li className="appointment-item">
      <div className="header-container">
        <h2>Description</h2>
        <hr />
        <p className="title">{title}</p>
        <p className="date"> {email}</p>
        <p className="date"> {website}</p>
        <p className="date"> {gender}</p>
        <p className="skills"> {skills.join(', ')}</p>
      </div>
      <div className="vertical-line"></div>

      <div>
      
          <img
            src={image}
            alt="user"
            style={{ width: '50px', height: '50px', borderRadius: '50%' }}
          />
      
      </div>
    </li>
  );
};

export default AppointmentItem;
